-- ABMag: Makes use of a reference spectrum of constant flux density per
-- unit frequency 3.631×10^-20 эрг/(с·Гц·см²).
instance MagnitudeSystem ABMag where
  -- В идеальной AB системе нулевая звездная величина приписывается
  -- объекту, от которого регистрируется столько же отсчетов в секунду, как
  -- и от объекта с постоянным распределением по частоте энергии в спектре
  -- равным 3631 Ян ( 3.631×10^-20 эрг/(с·Гц·см²) ).

  -- Спектр объекта нулевой звездной величины в эрг/(с·A·см²).  Спектр
  -- определен в интервале от 1100 A до 30000 A.
  refSpectrum _ = [ (w, 3.631e-20 * c/(w*w)) | w <- [1100, 1110 .. 30000] ]
    where
      -- Скорость света в A/с.
      c = 2.99792458E+18

-- STmag: Introduced for the HST project, it makes use of a reference
-- spectrum of constant flux density per unit of wavelength 3.631×10^-9 эрг/(с·А·см²).
instance MagnitudeSystem STMag where
  -- В идеальной ST системе нулевая звездная величина приписывается объекту,
  -- от которого регистрируется столько же отсчетов в секунду, как и от
  -- объекта с постоянным распределением по длине волны энергии в спектре
  -- равным 3.631×10^-9 эрг/(с·A·см²).

  -- Спектр объекта нулевой звездной величины в эрг/(с·A·см²).  Спектр
  -- определен в интервале от 1100 A до 30000 A, перекрывающем все полосы
  -- обзора SDSS.
  refSpectrum _ = [ (w, 3.631e-9) | w <- [1100, 1110 .. 30000] ]